        super(props);
        this.state = {
            username: this.props.username,
            playerNames: ['Sagnik','Jagori']
        }
    }

    componentDidMount()
    {
        console.log(this.state.username);
        // socket.emit("getPlayersInfo");
        // socket.on("playersInfo", (info) => {
        //     this.setState({
        //         players: info
        //     })
        // });
    }

    render()
    {
        return (
            <div style={{
                background: "rgba(0,0,0)",
                display: "flex",
                flexDirection: "column",
                minWidth: "10vw",
            }}>
                <div style={{
                    flex: 1,
                    overflow: "scroll",
                    // height: "50%",
                    background: "rgba(255,0,0)",
                    display: "flex",
                    flexDirection: "column",
                }}>
                    {this.state.playerNames.map( (name) => {
                        return (
                        <div style={{padding: "1em"}}>
                            {name}
                        </div>);
                     })}
                </div>
            </div>
        );
    }
}

export default Players;
